import "./services.scss";

export default function Services() {
  return (
    <div className="services" id="services">
      <div className="body-container">
        <h1>My Services</h1>
        <div className="card-wrapper">
          <div className="card"></div>
          <div className="card"></div>
          <div className="card"></div>
        </div>
      </div>
    </div>
  );
}
